import React from 'react';
import './blogPage.css';
import blogBackground from '../../assets/rotatingdandelion.gif';

const BlogPage = () => {
  return (
    <div className='blogPage'>
      <img src={blogBackground} alt='err404'></img>
    </div>
  )
}

export default BlogPage
